--create database batteriaitalia;

create table user_permission
(
   user_permission_id int primary key, -- no identity, so you can control the values
   user_permission varchar(20) not null unique
);


create table users(
	users_id int PRIMARY KEY NOT NULL IDENTITY(1,1),
	nome varchar(40),
    email varchar(45),
	passwd varchar(80),
	permission int not null default 0, 
	constraint fk_user_rank foreign key (permission) references user_permission (user_permission_id)
	);

create table menu(
menu_id int PRIMARY KEY NOT NULL IDENTITY(1,1),
pagename varchar(40),
pageurl varchar(40),
menu_permission int not null default 0, 
constraint fk_menu_rank foreign key (menu_permission) references user_permission (user_permission_id)
);

create table clients(
	clients_id int PRIMARY KEY NOT NULL  IDENTITY(1,1),
	nome varchar(30),
	cognome varchar(30),
	telefono varchar(15),
	mail varchar(40),
	ccap int,
	via varchar(50),
	civico varchar(8)
	);


	create table workOrder_difficolta
(
   workOrder_difficolta_id int primary key, -- no identity, so you can control the values
   difficolta varchar(20) not null unique
);


  	create table workOrder_stato(
   workOrder_stato_id int primary key, -- no identity, so you can control the values
   stato varchar(20) not null unique
);


create table tipoOggetto(
tipoOggetto_id int PRIMARY KEY NOT NULL  IDENTITY(1,1),
oggetto_nome varchar(40) not null unique
);


create table workOrders(
	workOrders_id int PRIMARY KEY NOT NULL  IDENTITY(1,1),
	clientId int,
	tipoOggetto int not null,
	modello varchar(50),
	accessori varchar(300),
	difetto varchar(300),
	difettofisso int, --1 fisso, 0 saltuario
	stato int not null default 0,
	difficolta int not null default 0,
	descrizione varchar(400),
	note varchar(400),
	dataInizio datetime not null,
	dataFine datetime,
	riferimento varchar(30),
	constraint fk_workOrder_difficolta foreign key (difficolta) references workOrder_difficolta (workOrder_difficolta_id),
	constraint fk_workOrder_stato foreign key (stato) references workOrder_stato (workOrder_stato_id),
	constraint fk_workOrder_tipoOggetto foreign key (tipoOggetto) references tipoOggetto (tipoOggetto_id),
	FOREIGN KEY (clientId) REFERENCES clients(clients_id)
);

create table workOrder_prove(
workOrder_prove_id int PRIMARY KEY NOT NULL  IDENTITY(1,1),
workOrdersId int not null,
userId int not null,
nomeProva varchar(50),
esitoProva varchar(50),
dataProva datetime,
FOREIGN KEY (workOrdersId) REFERENCES workOrders(workOrders_id),
FOREIGN KEY (userId) REFERENCES users(users_id)
);

--@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@ DA IMPLEMENTARE @@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
create table workOrder_difetti(
workOrder_difetti_id int PRIMARY KEY NOT NULL  IDENTITY(1,1),
workOrdersId int not null,
difetto varchar(100),
difettofisso int,
FOREIGN KEY (workOrdersId) REFERENCES workOrders(workOrders_id)
);
--@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@ --------------- @@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@

create table workOrder_user(
workOrder_user_id int NOT NULL IDENTITY(1,1),
userId int not null,
workOrderId int not null,
dataAssegnazione datetime,
FOREIGN KEY (workOrderId) REFERENCES workOrders(workOrders_id),
FOREIGN KEY (userId) REFERENCES users(users_id),
PRIMARY KEY (userId, workOrderId)
);
    

create table workOrderLog(
	workOrderLog_id int PRIMARY KEY NOT NULL  IDENTITY(1,1),
	workOrderId int not null,
	userId int not null,
	azione varchar(50),
	statoInziale int not null,
	statoFinale int not null,
	dataEvento datetime,
	constraint fk_workOrder_statoInziale foreign key (statoInziale) references workOrder_stato (workOrder_stato_id),
	constraint fk_workOrder_statoFinale foreign key (statoFinale) references workOrder_stato (workOrder_stato_id),
	FOREIGN KEY (workOrderId) REFERENCES workOrders(workOrders_id),
	FOREIGN KEY (userId) REFERENCES users(users_id)
	)
    


